import './App.css';
import Title from './Components/Title';
import Post from './Components/Post';

function App() {

  let posts = [{name: 'aaa',body:'fsdfds'},{name:'bbb',body:'fsbv'},{name:'ccc',body: 'fsbfgh'}];

  return (

    <div className="App">
      <Title/>
      <Post myname = {posts[0].name} postBody = {posts[0].body}/>
      <Post myname={posts[1].name} postBody={posts[1].body} />
      <Post myname={posts[2].name} postBody={posts[2].body} />

    </div>
  );
}

export default App;
